import { Typography } from '@mui/material'
import React from 'react'
import { useStyles } from './style'


const Phone = (props)=>{

  const s = useStyles()

  return(
    <>
      <Typography component={'div'}>{props.text}</Typography>
      <div><img src={props.img}/></div>
    </>
  )
}


export default Phone
